sql:
SELECT `Driver`, `Seasons`, `Entries`, `Podiums`, `Percentage`
FROM (
    SELECT `Driver`, `Seasons`, `Entries`, `Podiums`, `Percentage`,
           ROW_NUMBER() OVER (ORDER BY `Podiums` DESC) AS rn
    FROM (
        SELECT `Driver`, `Seasons`, `Entries`, `Podiums`, `Percentage`
        FROM `table_1_13599687_46`
    )
)
WHERE rn <= 7;

actual_sql:
SELECT col1, col2, col3, col4, col5
FROM (
    SELECT col1, col2, col3, col4, col5,
           ROW_NUMBER() OVER (ORDER BY col4 DESC) AS rn
    FROM (
        SELECT col1, col2, col3, col4, col5
        FROM `table_1_13599687_46`
    )
)
WHERE rn <= 7;

